import React from 'react';

const ZodiacGrid = () => {
  console.log('ZodiacGrid 组件正在渲染');
  
  return (
    <div style={{ 
      backgroundColor: 'red', 
      color: 'white', 
      padding: '20px', 
      margin: '20px',
      fontSize: '20px',
      textAlign: 'center'
    }}>
      <h2>测试：ZodiacGrid 组件已加载</h2>
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(3, 1fr)', 
        gap: '10px',
        marginTop: '20px'
      }}>
        <div style={{ backgroundColor: 'blue', padding: '10px' }}>白羊座 ♈</div>
        <div style={{ backgroundColor: 'blue', padding: '10px' }}>金牛座 ♉</div>
        <div style={{ backgroundColor: 'blue', padding: '10px' }}>双子座 ♊</div>
        <div style={{ backgroundColor: 'blue', padding: '10px' }}>巨蟹座 ♋</div>
        <div style={{ backgroundColor: 'blue', padding: '10px' }}>狮子座 ♌</div>
        <div style={{ backgroundColor: 'blue', padding: '10px' }}>处女座 ♍</div>
        <div style={{ backgroundColor: 'blue', padding: '10px' }}>天秤座 ♎</div>
        <div style={{ backgroundColor: 'blue', padding: '10px' }}>天蝎座 ♏</div>
        <div style={{ backgroundColor: 'blue', padding: '10px' }}>射手座 ♐</div>
        <div style={{ backgroundColor: 'blue', padding: '10px' }}>摩羯座 ♑</div>
        <div style={{ backgroundColor: 'blue', padding: '10px' }}>水瓶座 ♒</div>
        <div style={{ backgroundColor: 'blue', padding: '10px' }}>双鱼座 ♓</div>
      </div>
    </div>
  );
};

export default ZodiacGrid;
